import react from 'react';
import Explorer from './Explorer' 
import {addFile} from './addFile';
export const Files =  () => {
    return(
        <main>
        <h1>Explorer</h1>
        <h2>./files/</h2>
        <Explorer />
        <addFile/>
      </main>
    )
}
